int main(int argc, char **argv)
{
    int n, m, k;
    cin >> n >> m >> k;
    vector<mint> dp(m, 1);
    for (int i = 2; i <= n; ++i) {
        vector<mint> ndp(m);
        vector<mint> acc(m + 1);
        for (int j = 0; j < m; ++j)
            acc[j + 1] = acc[j] + dp[j];
        for (int j = 0; j < m; ++j) {
            if (j >= k)
                ndp[j] += acc[j - k + 1];
            if (j + k <= m)
                ndp[j] += acc[m] - acc[j + k];
        }

        dp.swap(ndp);
    }
    mint ans = 0;
    for (auto x : dp)
        ans += x;
    cout << ans.val() << endl;
    return 0;
